  return new Promise((resolve, reject) => {
    if (promise) {
      resolve({
        status: 200,
        body: 'success',
      });
    } else {
      reject(new Error());
    }
  })
    .then((response) => {
      console.log('Got a response from the API');
    })
    .catch((error) => {
      throw error;
    });
}

